import { Breadcrumbs } from "govuk-react";

function viewAppointment() {
    return(
        <div>

    <Breadcrumbs>
  <Breadcrumbs.Link href="/section">
    Section
  </Breadcrumbs.Link>
  <Breadcrumbs.Link href="/section/sub-section">
    Sub-section
  </Breadcrumbs.Link>
  Current page
</Breadcrumbs>

        </div>
    );

}
export default viewAppointment;
